import React from "react";
import {
  Input,
  InputField,
  Flex,
  Heading,
  Container,
  Columns,
  Text,
  Paragraph,
} from "bumbag";

const Contact = () => {
  return (
    <Container padding="2rem 1rem">
      <Flex
        display={{ default: "flex", "max-tablet": "block" }}
        alignX="center"
        alignY="center"
        alignItems="baseline"
      >
        <Columns.Column spread={6}>
          <Heading
            use="h4"
            fontWeight={{ default: "semibold", "max-tablet": "bold" }}
            paddingBottom={{ default: "0rem", "max-tablet": "2rem" }}
          >
            Contact
          </Heading>
        </Columns.Column>
        <Columns.Column spread={6}>
        <Input placeholder="Name" variant="underline"
        paddingBottom={{ default: "4rem", "max-tablet": "2rem" }} />
        <Input placeholder="E-mail" variant="underline"
        paddingBottom={{ default: "4rem", "max-tablet": "2rem" }} />
        <Input size="large" variant="underline" placeholder="Message" />
        </Columns.Column>
      </Flex>
    </Container>
  );
};

export default Contact;
